import React from 'react';

function Card(props){
	return (
		<div className='tc bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5'>
			<img alt="" src={props.img} width="300px" height="300px" />
			<h2>{props.name}</h2>
		</div>
	);
}

export default Card;
